 can cause P55008 arrest and induce apoptosis in pulmonary artery smooth muscle cells through a

 inhibitors have been shown to upregulate the cyclin-dependent kinase inhibitor

 . This caused a marked decrease in cyclin E kinase activity , which suggests an important role for

 in the ability of mevastatin to induce P55008 arrest . However , in PASMCs lacking functional

 , mevastatin still decreased cyclin E kinase activity , caused P55008 arrest , and decreased DNA synthesis . In

 - deficient PASMCs , mevastatin induced a greater reduction of cyclin E protein levels ( to 35 % of control ) than in wild-type cells ( to 70 % of control ) and also reduced the phosphorylation of cdk 2 on threonine 160 .

 - deficient PASMCs and was able to do so at a dose that did not induce cell cycle arrest . These data suggest that

 inhibitors can both inhibit cell proliferation and induce apoptosis in PASMCs through

 ) and secretin caused a secretion of bicarbonate from the gallbladder mucosa ( P &lt; 0.01 ) . This secretion was reduced by intraluminal ( i . l . ) acetazolamide ( P &lt; 0.01 ) . Bile flow was enhanced by infusion of

<h2 style="margin: 0">5</h2>

<div class="entities" style="line-height: 2.5; direction: ltr">Archaebacterial elongation factor is ADP-ribosylated by diphtheria toxin . Archaebacteria have been defined as a ' third primary kingdom ' of cells in addition to the urkaryotes and the eubacteria . While the latter two correspond approximately to the conventional categories eukaryotes and prokaryotes respectively , the Archaebacteria have up to now comprised four groups of microorganisms : the methanogenic bacteria , the extremely halophilic bacteria and the two thermoacidophilic genera Sulfolobus and Thermoplasma . Based on ribosomal RNA sequence homologies and lipid composition , they apparently form a distinct group . Furthermore they possess or lack typical biochemical markers of both the eukaryotes and the prokaryotes , as well as having unique properties not found elsewhere . Altogether , this indicates that they are not closer to either one of the classical categories . One clear-cut difference between prokaryotes and eukaryotes is the diphtheria toxin reaction , which catalyses the covalent binding of adenosine diphosphate-ribose ( 
<mark class="entity" style="background: linear-gradient(90deg, #CC9966, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">
    DB02059
    <span style="font-size: 0.8em; font-weight: bold; line-height: 1; border-radius: 0.35em; text-transform: uppercase; vertical-align: middle; margin-left: 0.5rem">MEN</span>
</mark>
 ) to the eukaryotic peptide elongation factor 
<mark class="entity" style="background: linear-gradient(90deg, #333366, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">
    P13639
    <span style="font-size: 0.8em; font-weight: bold; line-height: 1; border-radius: 0.35em; text-transform: uppercase; vertical-align: middle; margin-left: 0.5rem">REA</span>
</mark>
 in contrast to the homologous prokaryotic factor EF-G . We report here that diphtheria toxin also catalyses the ADP-riboslation of archaebacterial elongation factors . In this respect , these factors have to be assigned to the 
<mark class="entity" style="background: linear-gradient(90deg, #333366, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">
    P13639
    <span style="font-size: 0.8em; font-weight: bold; line-height: 1; border-radius: 0.35em; text-transform: uppercase; vertical-align: middle; margin-left: 0.5rem">REA</span>
</mark>
 type ; we suppose that the ADP-ribosylatable structure arising so early in evolution is of fundamental importance for the elongation process .</div>

<div class="entities" style="line-height: 2.5; direction: ltr">Hyperosmolar mannitol simulates expression of aquaporins 4 and 9 through a p38 mitogen-activated protein kinase-dependent pathway in rat astrocytes . The membrane pore proteins , aquaporins ( AQPs ) , facilitate the osmotically driven passage of water and , in some instances , small solutes . Under hyperosmotic conditions , the expression of some AQPs changes , and some studies have shown that the expression of

 is regulated by MAPKs . However , the mechanisms regulating the expression of

 and AQP 9 in cultured rat astrocytes , and intraperitoneal infusion of mannitol increased

<h2 style="margin: 0">7</h2>

<div class="entities" style="line-height: 2.5; direction: ltr">Retinoic acid treatment enhances the acetylcholine contents in the human teratocarcinoma cell line NTera - 2 . Human NTera - 2 / clone D1 teratocarcinoma cells are induced by retinoic acid ( RA ) to differentiate into postmitotic cells with morphological and biochemical characteristics of embryonic human neurones . Currently only limited information concerning peptide-contents and neurotransmitter pools of these cells is available . Zeller and Strauss [ Int . J . Dev . Neurosci . 1995 ; 13 ( 5 ): 437 ] described an increase in choline acetyltransferase ( 
<mark class="entity" style="background: linear-gradient(90deg, #333366, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">
    P28329
    <span style="font-size: 0.8em; font-weight: bold; line-height: 1; border-radius: 0.35em; text-transform: uppercase; vertical-align: middle; margin-left: 0.5rem">REA</span>
</mark>
 ) activity in RA-treated , but not in untreated NTera - 2 cells , suggesting the induction of a cholinergic phenotype during treatment with RA . In the present study we investigated the effect of RA-differentiation on the amount of the neurotransmitters acetylcholine ( ACh ) , and dopamine in NTera - 2 in order to specify the transmitter phenotype induced by RA-differentiation . We found that a 4 - week treatment of NTera - 2 cells with 10 microM RA markedly increased the ACh-content of these cells , while dopamine levels were unchanged . Depolarisation with potassium ( 60 mM ) enhanced ACh-outflow in the differentiated cells in a Ca ( + + ) dependent way . Also neuropeptides like DB05875 and 
<mark class="entity" style="background: linear-gradient(90deg, #333366, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">
    P01303
    <span style="font-size: 0.8em; font-weight: bold; line-height: 1; border-radius: 0.35em; text-transform: uppercase; vertical-align: middle; margin-left: 0.5rem">REA</span>
</mark>
 were detectable in the undifferentiated NTera - 2 cells , while vasointestinal peptide ( 
<mark class="entity" style="background: linear-gradient(90deg, #333366, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">
    P01282
    <span style="font-size: 0.8em; font-weight: bold; line-height: 1; border-radius: 0.35em; text-transform: uppercase; vertical-align: middle; margin-left: 0.5rem">REA</span>
</mark>
 ) could not be found in either precursor or RA-differentiated cells . Differentiation was accompanied by a marked reduction of neutral endopeptidase enzyme activity and aminopeptidase activity . From these observations it was concluded that RA induces a cholinergic neurochemical differentiation of this human teratocarcinoma cell line , and that these cells might provide a model system to investigate cholinergic properties of human origin .</div>

 : future perspective in topical glaucoma therapeutics . Through this review it is contemplated that acetazolamide ( Q9Y6V0 ) , an age-old treatment for glaucoma with a myriad of side effects and inadequate topical effectiveness , may be formulated into a topically effective agent by utilizing various newer formulation approaches of ocular drug delivery . Even though it has a poor solubility and penetration power , various studies mentioned in the review indicate that it is possible to successfully formulate topically effective Q9Y6V0 by using : ( i ) high concentration of the drug , ( ii ) surfactant gel preparations of Q9Y6V0 , ( iii ) Q9Y6V0 loaded into liposomes , ( iv ) cyclodextrins to increase the solubility and hence bioavailability of Q9Y6V0 , and ( v ) viscolyzers and other polymers either alone or in combination with cyclodextrins . With the advent of newer topical carbonic anhydrase inhibitors ( CAIs ) like dorzolamide and brinzolamide , a localized effect with fewer side effects is expected . But whenever absorbed systemically , a similar range of adverse effects ( attributable to sulphonamides ) may occur upon use . Furthermore , oral Q9Y6V0 is reported to be more physiologically effective than 2 % dorzolamide hydrochloride administered topically , even though in isolated tissues dorzolamide appears to be the most active as it shows the lowest IC ( 50 ) values for 
<mark class="entity" style="background: linear-gradient(90deg, #333366, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">
    P00918
    <span style="font-size: 0.8em; font-weight: bold; line-height: 1; border-radius: 0.35em; text-transform: uppercase; vertical-align: middle; margin-left: 0.5rem">REA</span>
</mark>
 and 
<mark class="entity" style="background: linear-gradient(90deg, #333366, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">

    <span style="font-size: 0.8em; font-weight: bold; line-height: 1; border-radius: 0.35em; text-transform: uppercase; vertical-align: middle; margin-left: 0.5rem">REA</span>
</mark>
 [ M . F . Surgue , J . Ocular Pharmacol . Ther . 12 ( 1996 ) 363-376 ] . Hence , there exists considerable scope for the development of more / equally effective and inexpensive topically effective formulations of Q9Y6V0 . The use of various formulation technologies discussed in this review can provide a fresh impetus to research in this area .</div>
